            <div className='sidebar-titles article-link'>articles</div>
            {/* <div className='sidebar-titles'>engineer, thrifter, cat lady</div> */}
        </div>

        <div className='sidebar-info'>

        </div>

        {/* <div className='links'>
          <a className='ind-link' href='/'>about</a> | <a className='ind-link' href='/projects'>projects</a> | <a className='ind-link' href='/articles'>articles</a>
        </div> */}

      </div>

      <Router>
          <Route exact path="/" component={HomeComponent}></Route>
      </Router>

    </div>

  );
};

export default App;
